static int
autohelperattpat9(struct pattern *patt, int transformation, int move, int color, int action)
{
  int A;
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);

  A = offset(-1, -2, move, transformation);

  return  countlib(A)==1;
}

static int
autohelperattpat10(struct pattern *patt, int transformation, int move, int color, int action)
{
  int b, A;
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);

  b = offset(1, -1, move, transformation);
  A = offset(2, 0, move, transformation);

  return countlib(A)==1 && accurate_approxlib(move,color, MAX_LIBERTIES, NULL)>1 && countlib(b)>1;
}


