static int
autohelperdefpat0(struct pattern *patt, int transformation, int move, int color, int action)
{
  UNUSED(transformation);
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);


  return accurate_approxlib(move,color, MAX_LIBERTIES, NULL)>1;
}

static int
autohelperdefpat1(struct pattern *patt, int transformation, int move, int color, int action)
{
  int a, b;
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);

  a = offset(0, -2, move, transformation);
  b = offset(1, 0, move, transformation);

  return ATTACK_MACRO(a) && play_attack_defend_n(color, 0, 2, move, b, a);
}

static int
autohelperdefpat10(struct pattern *patt, int transformation, int move, int color, int action)
{
  int a;
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);

  a = offset(-3, 1, move, transformation);

  return countlib(a)>2;
}

static int
autohelperdefpat31(struct pattern *patt, int transformation, int move, int color, int action)
{
  int a, b, C;
  UNUSED(patt);
  UNUSED(color);
  UNUSED(action);

  a = offset(0, -2, move, transformation);
  b = offset(1, -1, move, transformation);
  C = offset(0, -1, move, transformation);

  return countlib(a)>1 && countlib(b)>1 && countlib(C)<=2 && accurate_approxlib(move,color, MAX_LIBERTIES, NULL)>1;
}


